(function link() {
	for (let p in frontierPokemon) {
		frontierPokemon[p].species = pokemon[frontierPokemon[p].species];
		frontierPokemon[p].nature  = natures[frontierPokemon[p].nature];
		for (let i = 0; i < frontierPokemon[p].moves.length; i++) {
			frontierPokemon[p].moves[i] = moves[ frontierPokemon[p].moves[i] ];
		}
	}
})();

function frontierPokemon_export(frontierPoke, levelOverride, ivOverride) {
	let level = levelOverride ?? 50;
	let iv    = ivOverride    ??  3;
	
	let lines = [];
	
	//lines.push(`${frontierPoke.species.name} @ ${frontierPoke.item} ** ${frontierPoke.name}`);
	lines.push(`${frontierPoke.species.name} @ ${frontierPoke.item}`);
	
	//if (level !== 100) {
		lines.push(`Level: ${level}`);
	//}
	
	lines.push(`${frontierPoke.nature.name} Nature`);
	
	let exportNames = [ "HP", "Atk", "Def", "SpA", "SpD", "Spe" ];
	let evStr = Object.values(frontierPoke.evs).map((v, i) => `${v} ${exportNames[i]}`)
	                                           .filter(evStr => !evStr.startsWith("0 "))
	                                           .join(" / ");
	lines.push(`EVs: ${evStr}`);
	
	if (iv !== 31) {
		lines.push(`IVs: ${iv} HP / ${iv} Atk / ${iv} Def / ${iv} SpA / ${iv} SpD / ${iv} Spe`);
	}
	
	for (let i = 0; i < frontierPoke.moves.length; i++) {
		lines.push(`- ${frontierPoke.moves[i].name}`);
	}
	
	return lines.join("\n");
}
